
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='92' height='92'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #g4022
	ctx.save();
	ctx.transform(1.000000, 0.000000, 0.000000, 1.000000, 5.916224, -0.275557);
	
// #polygon9
	ctx.save();

	ctx.miterLimit = 10;
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.lineWidth = 59.935333;
	ctx.moveTo(569.810000, 502.130000);
	ctx.lineTo(569.810000, 502.130000);
	ctx.lineTo(299.900000, 657.960000);
	ctx.lineTo(30.000000, 502.130000);
	ctx.lineTo(30.000000, 190.470000);
	ctx.lineTo(299.900000, 34.640000);
	ctx.lineTo(569.810000, 190.470000);
	ctx.stroke();
	ctx.restore();
	
// #line11
	ctx.beginPath();
	ctx.miterLimit = 10;

	ctx.moveTo(22.288662, 56.893097);
	ctx.lineTo(76.328239, 25.694118);
	ctx.stroke();
	ctx.restore();

    </script>
</body>
</html>
